import NavBar from "../components/NavBar";
import PlanetList from "../context/PlanetList.js";
import { useEffect, useState } from "react";
//BOOTSTRAP
import { Container, Row, Col, Button } from "react-bootstrap";
const Planets = () => {
  const pList = [
    { Name: null, Population: null, Img: null, Ships: [], key: null },
  ];
  const [allPlanets, setAllPlanets] = useState(pList);
  useEffect(() => {
    if (allPlanets.length === 1) {
      setAllPlanets((allPlanets) => {
        return PlanetList;
      });
    }
  }, [allPlanets]);
  console.log(allPlanets);
  return (
    <Container>
      <NavBar />
      {allPlanets.map((props) => {
        return (
          <Row className="singlePlanet" key={props.key}>
            <Col sm="2" className="planetPic no-float">
              <img
                src="data:image/jpeg;base64,"
                alt={props.Name}
              />
              <p>Name: {props.Name}</p>
              <p>Population: {props.Population}</p>
            </Col>
            <Col className="planetShipInfo justify-content-center">
              <div>
                <img
                  src="https://w7.pngwing.com/pngs/225/630/png-transparent-red-spaceship-rocket-icon-rocket-image-file-formats-cartoon-rocket-launch.png"
                  alt="planet"
                />
                <p>Name: testShip</p>
                <p>Passengers: 1000</p>
              </div>
            </Col>
          </Row>
        );
      })}
      <Row className="singlePlanet">
        <Col sm="2" className="planetPic no-float">
          <img
            src="data:image/jpeg;base64,"
            alt="planet"
          />
          <p>Name: Earth</p>
          <p>Population: 0</p>
        </Col>
        <Col className="planetShipInfo justify-content-center">
          <div>
            <img
              src="https://w7.pngwing.com/pngs/225/630/png-transparent-red-spaceship-rocket-icon-rocket-image-file-formats-cartoon-rocket-launch.png"
              alt="planet"
            />
            <p>Name: testShip</p>
            <p>Passengers: 1000</p>
          </div>
        </Col>
      </Row>
    </Container>
  );
};
export default Planets;
